css:
:root {
  font-size: 16px;
}
.gulp-control {
  color: rgba(131, 148, 150, 0.8);
}
.gulp-control .tasks {
  float: left;
  height: 100%;
  width: 25%;
  background: #002b36;
  border-right: 1px solid rgba(0, 0, 0, 0.1);
  padding: 10px;
  overflow-y: scroll;
}
.gulp-control .tasks .task {
  cursor: pointer;
  padding: 5px;
  border-radius: 4px;
}
.gulp-control .tasks .task.active {
  background: #43484d;
  color: rgba(131, 148, 150, 0.6);
}
.gulp-control .tasks .task.active.running {
  background: #5c6064;
}
.gulp-control .tasks .task:hover {
  color: rgba(131, 148, 150, 0.6);
}
.gulp-control .output {
  float: left;
  height: 100%;
  width: 75%;
  background: #002b36;
  padding: 10px;
  overflow-y: scroll;
}
.gulp-control .output pre {
  padding: 0;
  font-size: 11px;
  background: #002b36;
}
.gulp-control .output pre.error {
  color: #f44336;
}
